        img={bewear}
        number="#760"
        name="Bewear"
        kanji="キテルグマ"
        bgColor="#EDA5B3"
      /> */}
      <LeftArrow arrow={arrLeft} />
      <RightArrow arrow={arrRight} />
    </SliderContainer>
  );
};

export default Hero;
